import React from "react";
import styled from 'styled-components';

const Star = styled.div`
display: inline-block;
position: absolute;
    font-size: 32.5px;
    top: 6px;
}
`
const Wrapper = styled.div`
  position: relative;
  margin: 50px 125.5px 0 125.5px;
  padding: 0 30px;
`

export const About = () => {
    return <Wrapper>
        <h1>
            Мобильный <span>ID<Star>*</Star></span>
        </h1>
    </Wrapper>
}
